def p0(E, U, U_dag, Gell_Mann_article8):
	p0 = 0

	for k in range(0, 3):
		EU = np.dot(E[k], U)

		for n in range(0, 16):
			trace = np.einsum('ij,ji->', EU, Gell_Mann_article8[n])
			p0 += np.dot(trace, trace)
	return p0 				


def p0_2(E, U, U_dag, Gell_Mann_article8):
	p0 = 0

	for k in range(0, 3):
		PU = np.dot(P, U)
		PUE = np.dot(PU, E[k])
		PUEU = np.dot(PUE, U_dag)
		PUEUP = np.dot(PUEU, P) 

		for n in range(0, 4):
			trace = np.einsum('ij,ji->', PUEUP, Gell_Mann_article8[n])
			p0 += np.dot(trace, trace)
	return p0 / 8	


